import React,{Component} from "react";
import { render } from "react-dom";
import { useState } from "react";
import axios from "axios"
export default class Getzip extends Component{
    
    constructor(props){
        super(props)

        this.state = {
            zipData:[]
        }
    }

    async componentDidMount(){
        const url = "http://ctp-zip-api.herokuapp.com/zip/10305";
        const response = await fetch(url);
        const data = await response.json;
        this.setState({zipData : data.results[0]})
    }
    render(){
        return(<>
        <div>
                <div>{this.state.zipData.state}</div>
                <div></div>
                <div></div>
           
        </div>
        
        
        
        </>)
            
        
        

        
    }
        
        
}
